import React, { useState }  from 'react';




const Clicked = (e) =>{
   let [currentD, updateD] = useState(0)

   updateD(currentD+1)
}




const App = ()=>{
    return(
        <>
        <h1>{currentD}</h1>
        <button onClick= {Clicked}>Click</button>
        </>
    )
}


export default App;
